import { __decorate } from "tslib";
import { Component } from '@angular/core';
import { monkeyPatchChartJsLegend, monkeyPatchChartJsTooltip } from 'ng2-charts';
let ViewstatsComponent = class ViewstatsComponent {
    constructor(route, firebaseService, _route) {
        this.route = route;
        this.firebaseService = firebaseService;
        this._route = _route;
        this.no_data = false;
        this.pieChartLabels1 = [];
        this.pieChartData1 = [];
        this.pieChartType1 = 'pie';
        this.pieChartLegend1 = true;
        this.pieChartPlugins1 = [];
        this.pieChartLabels2 = [];
        this.pieChartData2 = [];
        this.pieChartType2 = 'pie';
        this.pieChartLegend2 = true;
        this.pieChartPlugins2 = [];
        this.pieChartLabels3 = [];
        this.pieChartData3 = [];
        this.pieChartType3 = 'pie';
        this.pieChartLegend3 = true;
        this.pieChartPlugins3 = [];
        this.barChartLabels = [];
        this.barChart2Type = 'bar';
        this.barChart2Legend = false;
        this.barChart2Plugins = [];
        this.barChart2Data = [];
        this.donutColors1 = [
            {
                backgroundColor: [
                    'rgba(92, 184, 92,1)',
                    'rgba(255, 195, 0, 1)',
                    'rgba(217, 83, 79,1)',
                    'rgba(129, 78, 40, 1)',
                    'rgba(129, 199, 111, 1)'
                ]
            }
        ];
        this.barChart2Options = {
            responsive: true,
            scales: {
                yAxes: [{
                        ticks: {
                            beginAtZero: true
                        }
                    }]
            }
        };
        this.pieChartOptions = {
            responsive: true,
            legend: {
                position: "top",
            }
        };
        monkeyPatchChartJsLegend();
        monkeyPatchChartJsTooltip();
    }
    async ngOnInit() {
        var user = localStorage.getItem("user");
        if (user === null) {
        }
        this.key = this.route.snapshot.paramMap.get("key");
        this.logs = await this.firebaseService.get_logs(this.key);
        if (this.logs == null) {
            this.no_data = true;
        }
        else {
            console.log(this.logs);
            for (var log of this.logs) {
                if (!this.pieChartLabels1.includes(log.os)) {
                    this.pieChartLabels1.push(log.os);
                    this.pieChartData1.push(1);
                }
                else {
                    this.pieChartData1[this.pieChartLabels1.indexOf(log.os)] += 1;
                }
                if (!this.pieChartLabels2.includes(log.browser)) {
                    this.pieChartLabels2.push(log.browser);
                    this.pieChartData2.push(1);
                }
                else {
                    this.pieChartData2[this.pieChartLabels2.indexOf(log.browser)] += 1;
                }
                if (!this.pieChartLabels3.includes(log.deviceType)) {
                    this.pieChartLabels3.push(log.deviceType);
                    this.pieChartData3.push(1);
                }
                else {
                    this.pieChartData3[this.pieChartLabels3.indexOf(log.deviceType)] += 1;
                }
                if (!this.barChartLabels.includes(log.country)) {
                    this.barChartLabels.push(log.country);
                    this.barChart2Data.push(1);
                }
                else {
                    this.barChart2Data[this.barChartLabels.indexOf(log.country)] += 1;
                }
            }
        }
    }
};
ViewstatsComponent = __decorate([
    Component({
        selector: 'app-viewstats',
        templateUrl: './viewstats.component.html',
        styleUrls: ['./viewstats.component.scss']
    })
], ViewstatsComponent);
export { ViewstatsComponent };
